embedfield:
How to match, lookup and project with filtering on the other table in MongoDB?<p>My goal is to get a list of active alerts and the corresponding read dates for a given user.</p>

<p>I have an <code>alerts</code> collection </p>

<pre><code>{
    "id" : "id",
    "field1": 1,
    "field2": 1,
    "field3": 1,
    "field4": 1,
    "status" : { "name": "ACTIVE" }
}

</code></pre>

<p>I am tracking when a user has read an alert using a <code>alertstracking</code> collection</p>

<pre><code>{ 
    "alertid" : "alertidvalue", 
    "userid" : "useridvalue", 
    "id" : "id", 
    "readdate" : ISODate("2020-02-14T00:45:45.959+0000")
}
</code></pre>

<p>This is the working query I have but was wondering if there are better/faster ways to do it.
I was going to index alertid, userid fields on the <code>alertstracking</code> collection.</p>

<pre><code>db.getCollection("alerts").aggregate([
    {
        $match: {
            "status.name": "ACTIVE"
        }
    },
    {
        $lookup: {
            from: "alertstracking",
            localField: "id",
            foreignField: "alertid",
            as: "alerttrack"
        }
    },
    {
        $project: {
            "id": 1,
            "field1": 1,
            "field2": 1,
            "field3": 1,
            "field4": 1,
            "useralerttrack": {
                $filter: {
                    input: "$alerttrack",
                    as: "track",
                    cond: {
                        $eq: ["$$track.userid", "useridvalue"]
                    }
                }
            }
        }
    },
    {
        $project: {
            "id": 1,
            "field1": 1,
            "field2": 1,
            "field3": 1,
            "field4": 1,
            "readdate": {
                $arrayElemAt: ["$useralerttrack.readdate", 0]
            }
        }
    }
])
</code></pre>

<p>I am hoping to avoid using <code>$project</code> twice and repeating the fields I want.
I had to do it to be able to access <code>useralerttrack</code>.</p>

