embedfield:
Using MongoDb Atlas full text search with multi-tenant collection ($searchBeta)<p>I have a MongoDb collection that holds data of thousands of tenants which are separated by a field holding the tenant ID.<br>
I want to perform a query that includes full-text search &amp; faceting on a specific tenant (see below).<br>
Since the $searchBeta must be the first phase in the aggregation pipeline, it means it will return a huge list of documents from all tenants just to filter them out on $match phase instead of using an index.<br>
Is there a more efficient way to perform such a query?<br>
Running it with $searchBeta takes 14 seconds while removing it reduces query time to 6ms (while faceting works on more documents since it includes all tenant's data).<br>
* Using Doug's answer bellow reduce it to ~70-120ms.<br>
* Time measurement was done on Atlas free tier so it doesn't mean too much </p>

<pre><code>db.tenantData.aggregate( [
{
    $searchBeta: {
        "search": {
        "query": "test",
        "path": ["name","comment"],
      }
    }
},
{
    $match: {tenant:"tenant1"},
},
{
    $facet: {
        "AssetTypeFacet": [
          { $sortByCount: "$assetType" }
        ],
        "manufacturerFacet": [
          { $sortByCount: "$manufacturer" }
        ]
    }
}
])    
</code></pre>

