Filtering a mongodb query result based on the position of a field in an array<p>Apologies for the confusing title, I am not sure how to summarize this.</p>

<p>Suppose I have the following list of documents in a collection:</p>

<pre class="lang-py prettyprint-override"><code>{ "name": "Lorem", "source": "A" }
{ "name": "Lorem", "source": "B" }
{ "name": "Ipsum", "source": "A" }
{ "name": "Ipsum", "source": "B" }
{ "name": "Ipsum", "source": "C" }
{ "name": "Foo",   "source": "B" }
</code></pre>

<p>as well an ordered list of accepted sources, where lower indexes signify higher priority</p>

<pre class="lang-py prettyprint-override"><code>sources = ["A", "B"]
</code></pre>

<p>My query should:</p>

<ul>
<li>Take a list of available sources and a list of wanted names</li>
<li>Return a maximum of one document per name.</li>
<li>In case of multiple matches, the document with the most prioritized source should be chosen.</li>
</ul>

<p>Example:</p>

<pre class="lang-py prettyprint-override"><code>wanted_names = ['Lorem', 'Ipsum', 'Foo', 'NotThere']
</code></pre>

<p>Result: </p>

<pre class="lang-py prettyprint-override"><code>{ "name": "Lorem", "source": "A" }
{ "name": "Ipsum", "source": "A" }
{ "name": "Foo",   "source": "B" }
</code></pre>

<p>The results don't necessarily have to be ordered.</p>

<p>Is it possible to do this with a Mongo query alone? If so could someone point me towards a resource detailing how to accomplish it?</p>

<p>My current solution doesn't support a list of names, and instead relies on a Python script to execute multiple queries:</p>

<pre><code>db.collection.aggregate([
    {$match: {
        "name": "Lorem",
        "source": {
            $in: sources
    }}},
    {$addFields: {
        "order": {
            $indexOfArray: [sources, "$source"]
    }}},
    {$sort: {
        "order": 1
    }},
    {$limit: 1}
]);
</code></pre>

<p>Note: <code>_id</code> fields are omitted in this question for the sake of brevity</p>

