Update subarray of objects in mongodb<p>I have this document in my database: </p>

<pre><code>{
    "_id": "ObjectId(...)",
    "chapters": [
        {
            "_id": "ObjectId(...)",
            "link": "128371.html",
            "content": ""
        }
    ]
}
</code></pre>

<p>The chapters array can have up to 3k items, and I have to populate each content attribute with some info. I want to be able to save the info I want inside the right object. Until now I was able to change the content attribute generally (in all items), but I am having trouble filtering it. This is what I managed to code using what I found in other questions:</p>

<pre><code>let content = "Testing";
await models.ListNovel.updateOne(
  { link: novel_link },
  { $set: { "chapters.$[].content": content } }
);
</code></pre>

<p>I saw that <code>{ arrayFilters: [{ link: { $eq: chapter_link } }], multi: false }</code> may work in some cases, but I don't use the link identifier in the update.</p>

<p>Thank you!</p>

<h2>UPDATE</h2>

<p>Similar to Suleyman's solution, I ended up with the following working code, I hope it may be useful for you.</p>

<pre><code>await models.ListNovel.updateOne(
  { link: novel.link },
  { $set: { "chapters.$[elem].content": content } },
  {
    multi: true,
    arrayFilters: [{ "elem.link": { $eq: chapter.link } }]
  }
);
</code></pre>

